import React from 'react';

export default class AddFolder extends React.Component {




    render () {
        return (
            <section>
                <h3>Create a Folder</h3>
                <form>
                    <label htmlFor="folder-input">
                        Name
                    </label>
                    <input type="text" id="folder-Input" name="folder-name"/>
                    <button type="submit">
                        Add Folder
                    </button>
                </form>
            </section>
        )
    }
}
